package com.hfad.tess;



import android.content.ContentValues;
import android.content.Context;
import android.database.sqlite.SQLiteDatabase;
import android.database.sqlite.SQLiteOpenHelper;
import android.support.annotation.Nullable;

public class DBHelper extends SQLiteOpenHelper {

    private static final String DB_name = "DB5";
    private static final int DB_version = 3;

    private String createAktivitetQuery = "CREATE TABLE aktivitet (_id INTEGER PRIMARY KEY AUTOINCREMENT, "
                                            + "navn TEXT,"
                                            + "beskrivelse TEXT,"
                                            + "type TEXT,"
                                            + "hjemmeside TEXT,"
                                            + "prisnivå TEXT,"
                                            + "utendørs NUMERIC,"
                                            + "latitude REAL,"
                                            + "longitude REAL,"
                                            + "bildeURL TEXT,"
                                            + "FOREIGN KEY (type) REFERENCES aktivitet_type(_id),"
                                            + "FOREIGN KEY (prisnivå) REFERENCES prisnivå(_id)"
                                            + ");";

    public DBHelper(@Nullable Context context) {
        super(context, DB_name, null, DB_version);
    }

    @Override
    public void onCreate(SQLiteDatabase db) {
        updateMyDatabase(db, 0, DB_version);
    }

    @Override
    public void onUpgrade(SQLiteDatabase db, int oldVersion, int newVersion) {
        updateMyDatabase(db, oldVersion, DB_version);
    }

    private static void insertAktivitet(SQLiteDatabase db, String navn, String beskrivelse, String type, String hjemmeside, String prisnivå, boolean utendørs, double latitude, double longitude, String bildeURL) {
        ContentValues aktivitetValues = new ContentValues();
        aktivitetValues.put("navn", navn);
        aktivitetValues.put("beskrivelse", beskrivelse);
        aktivitetValues.put("type", type);
        aktivitetValues.put("hjemmeside", hjemmeside);
        aktivitetValues.put("prisnivå", prisnivå);
        aktivitetValues.put("utendørs", utendørs);
        aktivitetValues.put("latitude", latitude);
        aktivitetValues.put("longitude", longitude);
        aktivitetValues.put("bildeURL", bildeURL);
        db.insert("aktivitet", null, aktivitetValues);
    }

    private void updateMyDatabase(SQLiteDatabase db, int oldVersion, int newVersion) {
        if (oldVersion < 1) {

            db.execSQL(createAktivitetQuery);

            insertAktivitet(db, "Bø Sommarland", "Badeland i Bø, Telemark. Masse vann og moro", "Badeland", "www.sommarland.no", "Middels", true, 59.4472, 9.0727, "data:image/jpeg;base64,");
            insertAktivitet(db, "Tusenfryd", "Fornøyelsespark i Ås, Akershus. Karuseller og berg-og-dalbaner pluss mye mer", "Fornøyelsespark", "www.tusenfryd.no", "Høy", true, 59.7490, 10.7783, "https://media.newmindmedia.com/TellUs/image/?file=5A7FF4050F3558A83832EAF262EDE0CD99F32233.jpg&dh=532&dw=800&cropX=0&cropY=0&cropH=2130&cropW=3200");
            insertAktivitet(db, "Kongeparken", "Fornøyelsespark i Stavanger", "Fornøyelsespark", "https://www.kongeparken.no", "Middels", true,  58.7775, 5.8414, "data:image/jpeg;base64,");
            insertAktivitet(db, "Hunderfossen", "Troll og moro for små og store barn", "Fornøyelsespark", "www.hunderfossen.no", "Høy", true, 61.2197, 10.4390, "https://assets.simpleviewcms.com/simpleview/image/fetch/c_fill,f_jpg,h_536,q_65,w_971/https://media.newmindmedia.com/TellUs/image/%3Ffile%3D_IB74670_1593882607.jpg%26dh%3D596%26dw%3D1200%26t%3D4");
            insertAktivitet(db, "Liseberg", "Fornøyelsespark i Gøteborg", "Fornøyelsespark", "https://www.liseberg.se", "Høy", true,  57.6969, 11.9903, "data:image/jpeg;base64,");
        }
        if (oldVersion < 2) {

            insertAktivitet(db, "Kongens utsikt", "Fjelltur i Hole kommune. Utsikt over store deler av Hole og Ringerike. Navnet stammer fra når kong Karl Johan besøkte stedet i 1832", "Fjelltur", "https://www.visitnorway.no/listings/topptur-til-kongens-utsikt/25182/", "Gratis", true,  60.0495289, 10.3069497,"https://www.skiforeningen.no/img/publish/24303.jpg");

            insertAktivitet(db, "Mørkonga", "Fjelltur i Hole kommune. Mørkgonga er en markert sprekk i lavaplata som dekker Krokskogen og ligger øverst i bratthenget mellom Gyrihaugen og Steinsfjorden i Åsa.", "Fjelltur", "https://www.ut.no/tur/2.1788/", "Gratis", true,  60.0991058,10.3789956, "https://assets.simpleviewcms.com/simpleview/image/fetch/c_fill,f_jpg,h_605,q_65,w_1200/https://media.newmindmedia.com/TellUs/image/%3Ffile%3DM_rkonga_883084057.png%26dh%3D537%26dw%3D647%26t%3D4");
        }
        if (oldVersion < 3) {

            insertAktivitet(db, "Pirbadet", "Badeland i Trondheim. Vann og moro for voksne og barn.", "Badeland", "https://www.pirbadet.no", "Middels", false,  63.4402936,10.398317, "https://tse3.mm.bing.net/th?id=OIP.LazR6U0fE1hENJPo8xVKawHaE8&pid=15.1&P=0&w=241&h=162");
        }
        if (oldVersion < 4) {
        }
    }
}


